import profilePic from '../images/profile-pic.PNG';

function Home(props) {
    const styles = {
        hero: {
            display: 'flex',
            padding: '20px',
            backgroundColor: 'rgb(230, 217, 194)'
        },
        intro: {
            alignSelf: 'center',
            textAlign: 'center',
            lineHeight: '40px'
        },
        button: {
            backgroundColor: 'rgb(128, 108, 84)',
            color: '#fff',
            height: '40px'
        },
        img: {
            borderRadius: '50%',
            height: '300px',
            width: '320px'
        }
      }

    return (
        <>
            <div>
                <h1>Hey, I'm Tamzin!</h1>
                <p>Front-End Web Developer</p>
                <hr/>
                <button href="mailto:tamzin.chikhalia@gmail.com" role="button">Contact Me</button>
            </div>
            <div>
                <img src={profilePic} alt="profile" />
            </div>
        </>
    );
  }

  export default Home;
